      SELECT col0 - - 99 AS col0 FROM tab2 WHERE - CAST ( + 65 AS INTEGER ) + + 41 <> ( col2 * - + col2 + - 94 );
  - name: tab2

outputs:
  - name: q8650.out
    data: |
      145
      163
      174
